import JohnWhiteSignature from './john-white-signature.svg'
export default function JohnWhiteLogo() {
  return (
      <img
        className="max-h-auto max-w-lg justify-self-center md:pb-7 px-12 md:px-0 mt-[35%] md:mt-[130px] xl:mt-[3%] mb-[50%] md:mb-[5%] w-screen xl:h-screen"
        alt="john-white-logo"
        aria-label="john-white-logo"
        src={JohnWhiteSignature}
      />
  );
}
